class Debloat {
    [System.Windows.Forms.Form]$Form
    [System.Windows.Forms.Panel]$Panel
    [System.Windows.Forms.FlowLayoutPanel]$FlowPanel
    [System.Windows.Forms.Button]$RemoveOneDriveButton
    [System.Windows.Forms.Button]$UnpinStartMenuButton
    [System.Windows.Forms.Label]$TextLabel

    Debloat() {
        $self = $this
        $this.Form = New-Object System.Windows.Forms.Form
            $this.Form.ClientSize = New-Object System.Drawing.Size(245,100)
            $this.Form.Padding = New-Object System.Windows.Forms.Padding(10)
            $this.Form.StartPosition = "CenterScreen"
            $this.Form.Text = "Debloater"
            $this.Form.BackColor = [System.Drawing.ColorTranslator]::FromHtml("#C0393B")
            $this.Base64Icon()

        $this.Panel = New-Object System.Windows.Forms.Panel
            $this.Panel.Size = New-Object System.Drawing.Size(220,80)
            $this.Panel.BackColor = [System.Drawing.ColorTranslator]::FromHtml("#2D3436")
            $this.Panel.Dock = "Fill"
            $this.Panel.Padding = New-Object System.Windows.Forms.Padding(10)
            $this.Form.Controls.Add($this.Panel)

        $this.FlowPanel = New-Object System.Windows.Forms.FlowLayoutPanel
            $this.FlowPanel.Dock = "Fill"
            $this.Panel.Controls.Add($this.FlowPanel)

        $this.RemoveOneDriveButton = New-Object System.Windows.Forms.Button
            $this.RemoveOneDriveButton.Text = "OneDrive entfernen"
            $this.RemoveOneDriveButton.Size = New-Object System.Drawing.Size(200,25)
            $this.RemoveOneDriveButton.ForeColor = [System.Drawing.ColorTranslator]::FromHtml("#C0393B")
            $this.RemoveOneDriveButton.BackColor = [System.Drawing.ColorTranslator]::FromHtml("#2D3436")
            $this.RemoveOneDriveButton.FlatStyle = "Flat"
            $this.RemoveOneDriveButton.Font = New-Object System.Drawing.Font("Consolas", 9)
            $this.FlowPanel.Controls.Add($this.RemoveOneDriveButton)
            # $removeOneDriveHandler = { $self.RemoveOneDrive() }.GetNewClosure()
            $this.RemoveOneDriveButton.Add_Click( {$self.RemoveOneDrive()}.GetNewClosure() )

        $this.UnpinStartMenuButton = New-Object System.Windows.Forms.Button
            $this.UnpinStartMenuButton.Text = "Startmenü-Icons entfernen"
            $this.UnpinStartMenuButton.Size = New-Object System.Drawing.Size(200,25)
            $this.UnpinStartMenuButton.ForeColor = [System.Drawing.ColorTranslator]::FromHtml("#C0393B")
            $this.UnpinStartMenuButton.BackColor = [System.Drawing.ColorTranslator]::FromHtml("#2D3436")
            $this.UnpinStartMenuButton.FlatStyle = "Flat"
            $this.UnpinStartMenuButton.Font = New-Object System.Drawing.Font("Consolas", 9)
