    Base64Icon() {
        $this.Form.ShowIcon = $true
        $Base64 = @"
    
"@
        $Bytes = [Convert]::FromBase64String($Base64)   # Byte-Array dekodieren
        $Stream = New-Object System.IO.MemoryStream(,$Bytes) # Stream erzeugen
        $Icon = [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::FromStream($Stream)).GetHicon())
        $this.Form.Icon = $Icon
    }
    RemoveOneDrive() {
        # Bestätigungsdialog anzeigen
        # $confirm = [System.Windows.Forms.MessageBox]::Show("Möchten Sie OneDrive wirklich entfernen?", "Bestätigung", [System.Windows.Forms.MessageBoxButtons]::YesNo, [System.Windows.Forms.MessageBoxIcon]::Question)
        # if ($confirm -ne [System.Windows.Forms.DialogResult]::Yes) { return }
        Start-Sleep 1

        $this.Form.Text = "Entferne OneDrive..."
        $this.FlowPanel.Visible = $false
        $this.Form.ClientSize = New-Object System.Drawing.Size(300, 120)

        # Anzeigetext hinzufügen
        $this.TextLabel = New-Object System.Windows.Forms.Label
        $this.TextLabel.Dock = [System.Windows.Forms.DockStyle]::Fill
        $this.TextLabel.TextAlign = [System.Drawing.ContentAlignment]::MiddleCenter
        $this.TextLabel.ForeColor = [System.Drawing.ColorTranslator]::FromHtml("#C0393B")
        $this.TextLabel.Text = "OneDrive wird entfernt. Bitte warten..."
        $this.Panel.Controls.Add($this.TextLabel)

        # OneDrive-Ordner sichern, falls er nicht leer ist
        if (Test-Path "$env:USERPROFILE\OneDrive\*") {
            # OneDrive-Ordner ist nicht leer, Backup durchführen
            $this.TextLabel.Text = "OneDrive-Ordner ist nicht leer. Sichere Dateien..."
            Start-Sleep 1

            # Backup-Ordner auf dem Desktop erstellen, falls er nicht existiert
            if (Test-Path "$env:USERPROFILE\Desktop\OneDriveBackupFiles") {
                $this.TextLabel.Text = "Ordner 'OneDriveBackupFiles' auf dem Desktop gefunden. Alle Dateien werden in diesen Ordner verschoben."
            } else {
                if (!(Test-Path "$env:USERPROFILE\Desktop\OneDriveBackupFiles")) {
                    $this.TextLabel.Text = "Erstelle Ordner 'OneDriveBackupFiles' auf dem Desktop. Alle Dateien werden in diesen Ordner verschoben."
                    New-Item -Path "$env:USERPROFILE\Desktop" -Name "OneDriveBackupFiles" -ItemType Directory -Force
                    Start-Sleep 1

                    $this.TextLabel.Text = "Erfolgreich den Ordner 'OneDriveBackupFiles' erstellt."
                }
            }
            Start-Sleep 1

            # OneDrive-Ordnerinhalt in den Backup-Ordner verschieben
            Move-Item -Path "$env:USERPROFILE\OneDrive\*" -Destination "$env:USERPROFILE\Desktop\OneDriveBackupFiles" -Force
            $this.TextLabel.Text = "Alle Dateien wurden in den Ordner 'OneDriveBackupFiles' auf dem Desktop verschoben."
            Start-Sleep 1

            # OneDrive-Ordner ist jetzt leer, fortfahren
            $this.TextLabel.Text = "Fahre mit der OneDrive-Deinstallation fort."
            Start-Sleep 1
        } else {
            # OneDrive-Ordner ist leer, fortfahren
            $this.TextLabel.Text = "OneDrive-Ordner ist leer. Fahre mit der OneDrive-Deinstallation fort."
            Start-Sleep 1

            $this.TextLabel.Text = "Aktiviere Gruppenrichtlinie 'Verweigern der Verwendung von OneDrive für die Dateispeicherung'."
            $OneDriveKey = 'HKLM:SOFTWARE\Policies\Microsoft\Windows\OneDrive'
            if (!(Test-Path $OneDriveKey)) {
                mkdir $OneDriveKey
                Set-ItemProperty $OneDriveKey -Name OneDrive -Value DisableFileSyncNGSC
            }
            Set-ItemProperty $OneDriveKey -Name OneDrive -Value DisableFileSyncNGSC
        }

        # OneDrive deinstallieren
        New-PSDrive  HKCR -PSProvider Registry -Root HKEY_CLASSES_ROOT
        $OneDrive = "$env:SYSTEMROOT\SysWOW64\OneDriveSetup.exe"
        $ExplorerReg1 = "HKCR:\CLSID\{018D5C66-4533-4307-9B53-224DE2ED1FE6}"
        $ExplorerReg2 = "HKCR:\Wow6432Node\CLSID\{018D5C66-4533-4307-9B53-224DE2ED1FE6}"
        
        # OneDrive-Prozesse beenden
        $this.TextLabel.Text = "Beende OneDrive-Prozesse"
        Stop-Process -Name "OneDrive*"
        If (!(Test-Path $OneDrive)) {
            # $onedrive = "$env:SYSTEMROOT\System32\OneDriveSetup.exe"

            New-PSDrive  HKCR -PSProvider Registry -Root HKEY_CLASSES_ROOT
            $OneDrive = "$env:SYSTEMROOT\SysWOW64\OneDriveSetup.exe"
            $ExplorerReg1 = "HKCR:\CLSID\{018D5C66-4533-4307-9B53-224DE2ED1FE6}"
            $ExplorerReg2 = "HKCR:\Wow6432Node\CLSID\{018D5C66-4533-4307-9B53-224DE2ED1FE6}"
            Stop-Process -Name "OneDrive*"
            Stop-Process -Name "Microsoft OneDriveFile*"
            Start-Sleep 2


            If (!(Test-Path $OneDrive)) { $OneDrive = "$env:SYSTEMROOT\System32\OneDriveSetup.exe" }
            Start-Process $OneDrive "/uninstall" -NoNewWindow -Wait
            Start-Sleep 2
            
            $this.TextLabel.Text = "Beende Datei-Explorer"
            Start-Sleep 1
            taskkill.exe /F /IM explorer.exe
            Start-Sleep 3

            $this.TextLabel.Text = "Entferne verbleibende Dateien"
            Remove-Item "$env:USERPROFILE\OneDrive" -Force -Recurse
            Remove-Item "$env:LOCALAPPDATA\Microsoft\OneDrive" -Force -Recurse
            Remove-Item "$env:PROGRAMDATA\Microsoft OneDrive" -Force -Recurse
            If (Test-Path "$env:SYSTEMDRIVE\OneDriveTemp") { Remove-Item "$env:SYSTEMDRIVE\OneDriveTemp" -Force -Recurse }

            $this.TextLabel.Text = "Entferne OneDrive aus dem Windows Explorer"
            If (!(Test-Path $ExplorerReg1)) { New-Item $ExplorerReg1 }
            Set-ItemProperty $ExplorerReg1 System.IsPinnedToNameSpaceTree -Value 0 
            If (!(Test-Path $ExplorerReg2)) { New-Item $ExplorerReg2 }
            Set-ItemProperty $ExplorerReg2 System.IsPinnedToNameSpaceTree -Value 0

            $this.TextLabel.Text = "Starte den zuvor beendeten Explorer neu."
            Start-Process explorer.exe -NoNewWindow
        
            $this.TextLabel.Text = "Aktiviere die Gruppenrichtlinie 'Verweigern der Verwendung von OneDrive für die Dateispeicherung'"
            $OneDriveKey = 'HKLM:Software\Policies\Microsoft\Windows\OneDrive'
            If (!(Test-Path $OneDriveKey)) { Mkdir $OneDriveKey }
            Start-Process $OneDrive "/uninstall" -NoNewWindow -Wait
            Start-Sleep 2

            $this.TextLabel.Text = "Beende Datei-Explorer"
            Start-Sleep 1
            taskkill.exe /F /IM explorer.exe
            Start-Sleep 3

            $this.TextLabel.Text = "Entferne verbleibende Dateien"
            If (Test-Path "$env:USERPROFILE\OneDrive") { Remove-Item "$env:USERPROFILE\OneDrive" -Force -Recurse }
            If (Test-Path "$env:LOCALAPPDATA\Microsoft\OneDrive") { Remove-Item "$env:LOCALAPPDATA\Microsoft\OneDrive" -Force -Recurse }
            If (Test-Path "$env:PROGRAMDATA\Microsoft OneDrive") { Remove-Item "$env:PROGRAMDATA\Microsoft OneDrive" -Force -Recurse }
            If (Test-Path "$env:SYSTEMDRIVE\OneDriveTemp") { Remove-Item "$env:SYSTEMDRIVE\OneDriveTemp" -Force -Recurse }

            $this.TextLabel.Text = "Entferne OneDrive aus dem Windows Explorer"
            If (!(Test-Path $ExplorerReg1)) { New-Item $ExplorerReg1 }
            Set-ItemProperty $ExplorerReg1 System.IsPinnedToNameSpaceTree -Value 0 
            If (!(Test-Path $ExplorerReg2)) { New-Item $ExplorerReg2 }
            Set-ItemProperty $ExplorerReg2 System.IsPinnedToNameSpaceTree -Value 0

            $this.TextLabel.Text = "Starte den zuvor beendeten Explorer neu."
            Start-Process explorer.exe -NoNewWindow

            $this.TextLabel.Text = "OneDrive wurde erfolgreich deinstalliert!"
            Remove-item env:OneDrive
        }

        # Aktualisiere die Benutzeroberfläche
        $this.FlowPanel.PerformLayout()
        $this.Form.Refresh()
        [System.Windows.Forms.Application]::DoEvents()
        
        # Reset Form
        $this.FlowPanel.Visible = $true
        $this.Form.Text = "Debloater"
        $this.Form.ClientSize = New-Object System.Drawing.Size(245, 100)
        $this.Panel.Controls.Remove($this.TextLabel)
    }
    UnpinStartMenuIcons() {
        # Bestätigungsdialog anzeigen
        # $confirm = [System.Windows.Forms.MessageBox]::Show("Möchten Sie Startmenü-Icons wirklich entfernen?", "Bestätigung", [System.Windows.Forms.MessageBoxButtons]::YesNo, [System.Windows.Forms.MessageBoxIcon]::Question)
        # if ($confirm -ne [System.Windows.Forms.DialogResult]::Yes) { return }
        Start-Sleep 1

        $this.Form.Text = "Startmenü-Icons entfernen..."
        $this.FlowPanel.Visible = $false
        $this.Form.ClientSize = New-Object System.Drawing.Size(300, 120)

        # Anzeigetext hinzufügen
        $this.TextLabel = New-Object System.Windows.Forms.Label
        $this.TextLabel.Dock = [System.Windows.Forms.DockStyle]::Fill
        $this.TextLabel.TextAlign = [System.Drawing.ContentAlignment]::MiddleCenter
        $this.TextLabel.ForeColor = [System.Drawing.ColorTranslator]::FromHtml("#C0393B")
        $this.TextLabel.Text = "Startmenü-Icons werden entfernt. Bitte warten..."
        $this.Panel.Controls.Add($this.TextLabel)

        # Definiere das gewünschte Startmenü-Layout als XML-String
        $START_MENU_LAYOUT = @"
<LayoutModificationTemplate xmlns:defaultlayout="http://schemas.microsoft.com/Start/2014/FullDefaultLayout" xmlns:start="http://schemas.microsoft.com/Start/2014/StartLayout" Version="1" xmlns:taskbar="http://schemas.microsoft.com/Start/2014/TaskbarLayout" xmlns="http://schemas.microsoft.com/Start/2014/LayoutModification">
<LayoutOptions StartTileGroupCellWidth="6" />
<DefaultLayoutOverride>
    <StartLayoutCollection>
        <defaultlayout:StartLayout GroupCellWidth="6" />
    </StartLayoutCollection>
</DefaultLayoutOverride>
</LayoutModificationTemplate>
"@
        $layoutFile="C:\Windows\StartMenuLayout.xml"

        #Lösche die Layout-Datei, falls sie bereits existiert
        If ( Test-Path $layoutFile ) { Remove-Item $layoutFile }

        # Erstelle die neue Layout-Datei mit dem definierten XML-Layout
        $START_MENU_LAYOUT | Out-File $layoutFile -Encoding ASCII

        $regAliases = @("HKLM", "HKCU")

        # Weisen Sie das Startlayout zu und erzwingen Sie die Anwendung mit "LockedStartLayout" sowohl auf Maschinen- als auch auf Benutzerebene
        foreach ($regAlias in $regAliases){
            $basePath = $regAlias + ":\SOFTWARE\Policies\Microsoft\Windows"
            $keyPath = $basePath + "\Explorer" 
            IF(!(Test-Path -Path $keyPath)) { 
                New-Item -Path $basePath -Name "Explorer"
            }
            Set-ItemProperty -Path $keyPath -Name "LockedStartLayout" -Value 1
            Set-ItemProperty -Path $keyPath -Name "StartLayoutFile" -Value $layoutFile
        }

        # Explorer neu starten, damit die Änderungen wirksam werden. 
        # Das Startmenü-Layout wird nun auf das definierte XML-Layout gesetzt, und die Benutzer können keine Änderungen daran vornehmen.
        Stop-Process -name explorer
        Start-Sleep -s 5
        $wshell = New-Object -ComObject wscript.shell; $wshell.SendKeys('^{ESCAPE}')
        Start-Sleep -s 5

        # Entfernen der Sperre, damit Benutzer das Startmenü-Layout wieder anpassen können, falls gewünscht.
        foreach ($regAlias in $regAliases){
            $basePath = $regAlias + ":\SOFTWARE\Policies\Microsoft\Windows"
            $keyPath = $basePath + "\Explorer" 
            Set-ItemProperty -Path $keyPath -Name "LockedStartLayout" -Value 0
        }

        # Explorer neu starten und die Layout-Datei löschen
        Stop-Process -name explorer

        # Das neue Startmenü-Layout wird sofort angewendet, und die Benutzer können es nach dem Neustart des Explorers anpassen, wenn sie möchten.
        Import-StartLayout -LayoutPath $layoutFile -MountPath $env:SystemDrive\
        Remove-Item $layoutFile

        # Aktualisiere die Benutzeroberfläche
        $this.FlowPanel.PerformLayout()
        $this.Form.Refresh()
        [System.Windows.Forms.Application]::DoEvents()
        
        # Reset Form
        $this.FlowPanel.Visible = $true
        $this.Form.Text = "Debloater"
        $this.Form.ClientSize = New-Object System.Drawing.Size(245, 100)
        $this.Panel.Controls.Remove($this.TextLabel)
    }

    [void]Show() {
        [void]$this.Form.ShowDialog()
    }
}
